import client from '../util/shopify-client'



const MyProducts = () => {
    client.product.fetchAll().then((products) => (
       <div style={{
            position:"relative",
            backgroundColor:"red",
            top:"50vh"
       }}>
            Hello there and welcome
       </div>
    ))

}


const Store = () => {
    return(
        <div>
            <MyProducts />
        </div>
    )
}

export default Store;
